function AddCart(a, b) { AddItemToCart(a, b, true) }
function AddItemToCart(packId, quantity, showTip) {
    if (showTip) {
        var $tip = $(".addedtip");
        if (!$tip.is(":visible")) {
            $tip.fadeIn().delay(5000).fadeOut("slow")
        }
    }
    var channel = window.channel || "";
    var r = new Date().getTime();
    //var url = "/Kooboo-Submit/Cart?action=add-item&prductPriceId=" + packId + "quantity=" + quantity + "&channel=" + channel + "&r=" + r;
    var url = "/Kooboo-Submit/Cart?action=add-item&r=" + r;
    var data = {
        __RequestVerificationToken: $('#__AjaxAntiForgeryForm input[name=__RequestVerificationToken]').val(),
        productPriceId: packId,
        quantity: quantity,
        channel: channel
    }
    $.post(url, data, function (result) {
        if (result != "") {
            var oResultData = eval("(" + result + ")");
            $(".cartcount").text(oResultData.ItemsCount);
            $(".productcount").text(oResultData.ProductsCount);
            $(".cartamount").text(oResultData.Amount);
            $(".shippingcost").text(oResultData.ShippingCost);
            var topcart = $(".topcartlink");
            if (topcart.find(".cart-badge").length == 0) {
                topcart.append('<div class="cart-badge">' + oResultData.ProductsCount + "</div>")
            } else {
                $(".cart-badge").html(oResultData.ProductsCount)
            }
            $(".totalproducts").css("font-weight", "bold");
            $(".productcount").css("font-weight", "bold");
            var $usp_Shipping = $(".usp-shipping");
            if ($usp_Shipping.length > 0) {
                var amount = parseFloat(oResultData.Amount.replace(",", "."));
                if (amount <= 0) {
                    $usp_Shipping.html("Slechts €1,45 verzendkosten, <strong>gratis</strong> boven € 55,-")
                } else {
                    if (amount < 55) {
                        $usp_Shipping.html("Verzendkosten slechts €1,45, voeg nog €" + (55 - amount).toFixed(2).toString().replace(".", ",") + " aan producten toe en krijg <strong>gratis</strong> verzending!")
                    } else {
                        $usp_Shipping.html("U profiteert van <strong>gratis</strong> verzending!")
                    }
                }
            }
            if ($(".incentives-product").length) { refreshIncentivesOnProductPage(packId) }
        }
    });
}
function SelectTab(a) { $(".tabs").hide().filter(a).show(); SwitchTab(a); $(".product-top a").removeClass("selected"); $(".product-top a[href='" + a + "']").addClass("selected") } function SwitchTab(a) { switch (a) { case "#video": HideLeftPic(); break; case "#recensies": HideLeftPic(); break; case "#vragen": HideLeftPic(); break; default: $(".propics").show(); $(".protext").show(); break } return true } function HideLeftPic() { $(".propics").hide(); $(".protext").hide() } function AddedFavorite() { var a = $(".btn-add-favorite"); a.attr("href", "/Profile/Default.aspx#myFavorites"); a.html('<i class="icon-heart orange"></i>Toegevoegd aan uw Favorieten'); a.removeClass("btn-add-favorite") };